import React from "react";
import "../src/stylesheets/styles.scss";
import { StoryCard } from "./Storycard/index";
import { SuggestedSource } from "./Source";

function App() {
  return (
    <div className="App">
      <div>
        <StoryCard />
        <StoryCard />
      </div>

      <SuggestedSource />
    </div>
  );
}

export default App;
